/*
Note:

Return an empty list if there is no such transformation sequence.
All words have the same length.
All words contain only lowercase alphabetic characters.
You may assume no duplicates in the word list.
You may assume beginWord and endWord are non-empty and are not the same.
*/


//Time complexity O(L*N^2+N) = O(LN^2)
class Solution {
public:

    vector<vector<int>> dp;

    bool isadj(string &a, string &b) {
        int cnt = 0;
        int len = a.length();
        int i = 0;
        while (i<len) {
            if (a[i] != b[i]) cnt++;
            if (cnt > 1) return false;
            i++;
        }
        return true;
    }

    vector<vector<string>> findLadders(string beginWord, string endWord, vector<string>& wordList) {
        int n = wordList.size();
        
        vector<vector<string>> ret;
        int p = -1;
        int s = -1;

        for (int i = 0; i < n; i++) {
            if (wordList[i] == endWord) {
                p = i;
            }
            if (wordList[i] == beginWord) {
                s = i;
            }
        }
        if (p == -1) return ret;
        if (s == -1) {
            wordList.push_back(beginWord);
            s = n++;
        }

        vector<vector<int>> edges(n);

        for (int i = 0; i < n; i++) {
            string cur = wordList[i];
            for (int j = i + 1; j < n; j++) {
                if (isadj(cur, wordList[j])) {
                    edges[i].push_back(j);
                    edges[j].push_back(i);
                }
            }
        }

        vector<int> dist(n, INT_MAX);
        dist[s] = 0;
        queue<pair<int, vector<string>>> q;
        q.push(make_pair(s, vector<string>()));

        pair<int, vector<string>> cur;
        while (!q.empty()) {
            cur = q.front();
            q.pop();

            int idx = cur.first;
            vector<string> vec = cur.second;
            
            if (vec.size() <= dist[idx]) {
                dist[idx] = vec.size();
                vec.push_back(wordList[idx]);

                if (idx == p) {
                    ret.push_back(vec);
                    continue;
                }

                for (int k = 0; k < edges[idx].size(); k++) {
                    if (vec.size() <= dist[edges[idx][k]]) {
                        q.push(make_pair(edges[idx][k], vec));
                    }
                }
            }
        }

        return ret;
    }
};

